int num_docs(void) 
{
    int i = 0;
    for (i=0;g_documents[i];i++);
    return i;
}

const char ** get_doc(int i) 
{
    return g_documents[i];
}

unsigned int doc_size(int i) 
{
    int sz = 0;
    const char ** p = get_doc(i);
    do { sz += strlen(*p); } while(*(++p));
    return sz;
}
